import React from "react";
import "./App.css";
import { Switch, Route } from "react";
import CustomerList from "./containers/CustomerList";

function App() {
  return (
    <Switch>
      <Route exact path="/" component={CustomerList}></Route>
      <Route path="/user"></Route>
    </Switch>
  );
}

export default App;
